<script lang="ts" setup>
const props = defineProps({
  runAnim: {
    type: Boolean,
    default: false
  }
})

const points = ref<HTMLElement>(null)
const children = ref<HTMLCollection>(null)

const { pause, resume } = useIntervalFn(() => {
  animate()
}, 300)

onMounted(() => {
  children.value = points.value.children
  pause()
})

watch(() => props.runAnim, () => {
  console.log('runAnim', props.runAnim)
  props.runAnim ? resume() : pause()
})

function animate () {
  const randomPoints = ref(Math.floor(Math.random() * children.value.length))
  const randomAnimationSpeed = (Math.floor(Math.random() * (4 - 2 + 1)) + 2) * 1000

  if (randomPoints.value) {
    const child = ref<HTMLElement>(children.value[randomPoints.value] as HTMLElement)

    child.value.style.fill = '#00dc82'
    child.value.style.transitionDuration = `${randomAnimationSpeed}ms`
    child.value.style.transitionProperty = `fill`
    child.value.style.transitionTimingFunction = 'ease out'

    setTimeout(() => {
      child.value.style.fill = '#0F172A'
    }, randomAnimationSpeed)
  }
}
</script>

